import "./App.css";

function App() {
  const [image, setImage] = useState([]);
  const [like, setLike] = useState([]);

  useEffect(() => {
    fetch("https://picsum.photos/v2/list")
      .then((response) => response.json())
      .then((json) => setImage(json));
  }, []);
  const handleLike = (index) => {
    like.push(index);
    console.log(like);
  };
  return <></>;
}
export default App;
